import Link from 'next/link';

export default ({ page, description}) => (
  <div className="Session">
    <h2>
      <Link href={`/session?slug=${page}`}>
        <a>{title}</a>
      </Link>
    </h2>
    <p>{description}</p>
  </div>
);
